con:configuration.scriptText:
def sentPatientId = context.getProperty( "patientIdDos")

def responseContent = messageExchange.request.responseContent
def parsedResponseEnvelope = new groovy.xml.XmlSlurper(true,true,false).parseText(responseContent)

def cdataRequest = parsedResponseEnvelope.Body.HamtaPatientInfoResponse.extension.requestdata.data
def cdataContent = cdataRequest[0] as String
def parsedCdataContent = new groovy.xml.XmlSlurper(true, true, false).parseText(cdataContent)

def x509Certificate = parsedCdataContent.Header.Security.Assertion.Signature.KeyInfo.X509Data.X509Certificate.toString()
assert x509Certificate.length() > 100 : "Förväntat X509-certifikat ej hittat"

def personNummer = parsedCdataContent.Body.HamtaPatientInfo.personnummer.toString()
assert sentPatientId== personNummer : "Personnummer matchar inte"

